import {BrowserRouter, Routes, Route} from "react-router-dom";
import main from "./site/main";
import './css/main.css';

function App() {
    return (
        <div className="App">
            <BrowserRouter>
                <Routes>
                    <Route path="/" element={<main/>}/>
                </Routes>
            </BrowserRouter>
        </div>
    );
}

export default App;
